const  tokenKey = 'token';

export const authService = {
    getAuthToken: () => {
        return 'd8ad73af2a69f80b96abda4c528e9d31c474edd22a85d8041095cbbb32dcf39a81158cedf93ae79c3789425006f7ceeddd794dec1f0d612244d1f7e3496ea193';
    },
    setAuthToken: (token) => {
        return localStorage.setItem(tokenKey, token);
    },
    removeAuthToken: () => {
        return localStorage.removeItem(tokenKey);
    },
}
